css:
.nuclide-ui-hunk-diff-text-editor {
  background-color: #e8eaed;
  padding: 0.5em;
}
.nuclide-ui-hunk-diff-text-editor .line.cursor-line {
  background: transparent;
}
.nuclide-ui-file-changes:not(:first-child) {
  margin-top: 40px;
}
.nuclide-ui-file-changes-additions-deletion-count {
  margin-bottom: 0.5em;
}
.nuclide-ui-hunk-diff-spacer {
  height: 1em;
}
.nuclide-ui-file-changes-item {
  font-size: 12px;
}
.nuclide-ui-file-changes-item .nuclide-ui-file-changes-name {
  user-select: all;
}
.nuclide-ui-file-changes-item .nuclide-ui-file-changes-details {
  user-select: none;
}
.line-number.clickable {
  cursor: pointer;
}
/* BEGIN Keep in sync with nuclide-diff-view/styles: */
atom-text-editor .nuclide-ui-hunk-diff-insert .region {
  border-left-style: solid;
  border-left-color: #2db448;
  border-left-width: 1px;
  background-color: rgba(45, 180, 72, 0.1);
}
atom-text-editor .nuclide-ui-hunk-diff-delete .region {
  border-left-style: solid;
  border-left-color: #f42a2a;
  border-left-width: 1px;
  background-color: rgba(244, 42, 42, 0.1);
}
/* END Keep in sync with nuclide-diff-view/styles: */
